import * as React from "react";
import { Image, Text, View, Button } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { MaterialCommunityIcons } from "@expo/vector-icons";
import { StyleSheet } from "react-native";
import "./profileScreen.css";
import logo from "./app/assets/man.png";
import { TouchableOpacity } from "react-native-gesture-handler";

function HomeScreen() {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Home!</Text>
    </View>
  );
}

function ReceiptScreen() {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Receipt!</Text>
    </View>
  );
}

const styleButton = StyleSheet.create({
  title: {
    textAlign: "center",
    color: "black",
  },
  fitToText: {
    flexDirection: "column",
    justifyContent: "space-between",
  },
});

const buttonStyle = StyleSheet.create({
  view: {
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    backgroundColor: "blue",
  },
  title: {
    color: "red",
  },
});

function ProfileScreen() {
  return (
    <View style={{ flex: 1, backgroundColor: "white" }}>
      <View
        style={{ padding: 20, alignItems: "center", justifyContent: "center" }}
      >
        <Image source={logo} style={{ height: 100, width: 100 }}></Image>
      </View>

      <View style={{ alignItems: "center", justifyContent: "center" }}>
        <Text style={{ fontSize: 25 }}>Profile Name</Text>
      </View>

      <View style={{ padding: "5%" }}>
        <Text style={{ color: "#e91e63" }}>Account Settings</Text>
      </View>

      <div style={{ backgroundColor: "white" }} className="btn-group">
        <ul style={{ listStyle: "none" }}>
          <li>
            <button>Change Name</button>
          </li>
          <li>
            <button>Change Address</button>
          </li>
          <li>
            <button>Change Number</button>
          </li>
          <li>
            <button>Change Email</button>
          </li>
          <li>
            <button></button>
          </li>
        </ul>
      </div>
      <View style={(styleButton.title, styleButton.fitToText)}>
        <Button title="Change Name"></Button>
        <Button title="Change Address"></Button>
        <Button title="Change Number"></Button>
        <Button title="Change Email"></Button>
      </View>

      <View style={buttonStyle.view}>
        <TouchableOpacity style={buttonStyle.button}>
          <Text style={buttonStyle.title}>Change Name</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const Tab = createBottomTabNavigator();

function MyTabs() {
  return (
    <Tab.Navigator
      initialRouteName="HomeScreen"
      tabBarOptions={{
        activeTintColor: "#e91e63",
      }}
    >
      <Tab.Screen
        name="HomeScreen"
        component={HomeScreen}
        options={{
          tabBarLabel: "Home",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="home" color={color} size={size} />
          ),
        }}
      />
      <Tab.Screen
        name="Receipt"
        component={ReceiptScreen}
        options={{
          tabBarLabel: "Add",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="plus" color={color} size={size} />
          ),
        }}
      />
      <Tab.Screen
        name="Profile"
        component={ProfileScreen}
        options={{
          tabBarLabel: "Profile",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="account" color={color} size={size} />
          ),
        }}
      />
    </Tab.Navigator>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <MyTabs />
    </NavigationContainer>
  );
}
